import { NavLink, Link } from "react-router-dom";
import "../styles/nav.css";

import logo from "../assets/logo-3.png";

function Nav(){
  return(
    <>
    <nav className="navX">
      <div className="div_logo">
          <Link to="/">
            <img className="logo_img" src={logo} alt="logements" />
          </Link>
        </div>
    </nav>
    <nav className="navY">
      NAVIGATION verticale
    </nav>
    </>
  )
}
export default Nav;
